import React, { useState } from 'react';
import { useVoice } from '../context/VoiceContext';

const VoiceTest = () => {
  const { isListening, startListening, speak, isSupported } = useVoice();
  const [lastTranscript, setLastTranscript] = useState('');
  const [testResults, setTestResults] = useState([]);

  const runVoiceTest = () => {
    console.log('=== RUNNING VOICE TEST ===');
    
    if (!isSupported) {
      alert('Voice recognition not supported in this browser');
      return;
    }

    speak('Voice test starting. Please say hello when you hear the beep.');
    
    setTimeout(() => {
      // Make a beep sound
      speak('Beep');
      
      setTimeout(() => {
        console.log('Starting listening for test...');
        
        startListening(
          (transcript) => {
            console.log('TEST RESULT - Transcript:', transcript);
            setLastTranscript(transcript);
            
            const result = {
              timestamp: new Date().toLocaleTimeString(),
              transcript: transcript,
              success: true
            };
            
            setTestResults(prev => [result, ...prev.slice(0, 4)]);
            speak(`I heard you say: ${transcript}`);
          },
          (error) => {
            console.error('TEST ERROR:', error);
            
            const result = {
              timestamp: new Date().toLocaleTimeString(),
              transcript: `Error: ${error}`,
              success: false
            };
            
            setTestResults(prev => [result, ...prev.slice(0, 4)]);
            speak(`Voice test failed with error: ${error}`);
          }
        );
      }, 1000);
    }, 2000);
  };

  const testSpeech = () => {
    speak('Speech synthesis test. If you can hear this, speech output is working correctly.');
  };

  return (
    <div style={{
      position: 'fixed',
      top: '10px',
      left: '10px',
      background: 'white',
      padding: '20px',
      border: '2px solid #008080',
      borderRadius: '8px',
      zIndex: 1000,
      maxWidth: '400px'
    }}>
      <h3>üé§ Voice Recognition Test</h3>
      
      <div style={{ marginBottom: '10px' }}>
        <strong>Status:</strong> {isSupported ? '‚úÖ Supported' : '‚ùå Not Supported'}
      </div>
      
      <div style={{ marginBottom: '10px' }}>
        <strong>Listening:</strong> {isListening ? 'üé§ Yes' : '‚è∏Ô∏è No'}
      </div>
      
      <div style={{ marginBottom: '15px' }}>
        <button onClick={testSpeech} style={{ marginRight: '10px', padding: '8px 12px' }}>
          üîä Test Speech
        </button>
        <button onClick={runVoiceTest} disabled={isListening} style={{ padding: '8px 12px' }}>
          üé§ Test Voice Recognition
        </button>
      </div>
      
      {lastTranscript && (
        <div style={{ marginBottom: '15px', padding: '10px', background: '#f0f8ff', borderRadius: '4px' }}>
          <strong>Last heard:</strong> "{lastTranscript}"
        </div>
      )}
      
      <div>
        <strong>Test Results:</strong>
        {testResults.length === 0 ? (
          <div style={{ fontStyle: 'italic', color: '#666' }}>No tests run yet</div>
        ) : (
          <div style={{ maxHeight: '150px', overflowY: 'auto' }}>
            {testResults.map((result, index) => (
              <div key={index} style={{ 
                padding: '5px', 
                margin: '2px 0', 
                background: result.success ? '#e8f5e8' : '#ffe8e8',
                borderRadius: '3px',
                fontSize: '12px'
              }}>
                <div><strong>{result.timestamp}</strong></div>
                <div>{result.transcript}</div>
              </div>
            ))}
          </div>
        )}
      </div>
      
      <div style={{ marginTop: '10px', fontSize: '12px', color: '#666' }}>
        Open browser console (F12) for detailed logs
      </div>
    </div>
  );
};

export default VoiceTest;
